B.xA=new A.bh("1","Black","Black coffee is as simple as it gets with ground coffee beans steeped in hot water, served warm. And if you want to sound fancy, you can call black coffee by its proper name: cafe noir. Since it isn\u2019t doctored up with milk or sugar, the quality of coffee is especially important. Treat yourself to a coffee subscription box to find your favorite style.","https://images.pexels.com/photos/2916450/pexels-photo-2916450.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xp=new A.bh("2","Latte","As the most popular coffee drink out there, the latte is comprised of a shot of espresso and steamed milk with just a touch of foam. It can be ordered plain or with a flavor shot of anything from vanilla to pumpkin spice. (Here\u2019s how to make a copycat Starbucks pumpkin spice latte.)",u.o)
B.xu=new A.bh("3","Cappuccino","Cappuccino is a latte made with more foam than steamed milk, often with a sprinkle of cocoa powder or cinnamon on top. Sometimes you can find variations that use cream instead of milk or ones that throw in flavor shot, as well.","https://images.pexels.com/photos/1187317/pexels-photo-1187317.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xt=new A.bh("4","Americano","With a similar flavor to black coffee, the americano consists of an espresso shot diluted in hot water. Pro tip: if you\u2019re making your own, pour the espresso first, then add the hot water.","https://images.pexels.com/photos/6207297/pexels-photo-6207297.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.x9=new A.bh("5","Espresso","An espresso shot can be served solo or used as the foundation of most coffee drinks, like lattes and macchiatos.","https://images.pexels.com/photos/685527/pexels-photo-685527.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xh=new A.bh("6","Doppio","A double shot of espresso, the doppio is perfect for putting extra pep in your step.","https://images.pexels.com/photos/5882704/pexels-photo-5882704.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xo=new A.bh("7","Cortado","Like yin and yang, a cortado is the perfect balance of espresso and warm steamed milk. The milk is used to cut back on the espresso\u2019s acidity.","https://images.pexels.com/photos/2396220/pexels-photo-2396220.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xx=new A.bh("8","Red Eye","Named after those pesky midnight flights, a red eye can cure any tiresome morning. A full cup of hot coffee with an espresso shot mixed in, this will definitely get your heart racing.","https://images.pexels.com/photos/7173314/pexels-photo-7173314.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xb=new A.bh("9","Gal\xe3o","Originating in Portugal, this hot coffee drink is closely related to the latte and cappuccino. Only difference is it contains about twice as much foamed milk, making it a lighter drink compared to the other two.","https://images.pexels.com/photos/4669247/pexels-photo-4669247.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xf=new A.bh("10","Lungo","A lungo is a long-pull espresso. The longer the pull, the more caffeine there is and the more ounces you can enjoy.","https://images.pexels.com/photos/4226806/pexels-photo-4226806.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xk=new A.bh("11","Macchiato","The macchiato is another espresso-based drink that has a small amount of foam on top. It\u2019s the happy medium between a cappuccino and a doppio.","https://images.pexels.com/photos/5305639/pexels-photo-5305639.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xc=new A.bh("12","Mocha","For all you chocolate lovers out there, you\u2019ll fall in love with a mocha (or maybe you already have). The mocha is a chocolate espresso drink with steamed milk and foam.",u.o)
B.xe=new A.bh("13","Ristretto","Ristretto is an espresso shot. It uses less hot water which creates a sweeter flavor compared to the bitter taste of a traditional shot of espresso or a doppio.","https://images.pexels.com/photos/3756728/pexels-photo-3756728.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xq=new A.bh("14","Flat White","This Aussie-born drink is basically a cappuccino without the foam or chocolate sprinkle. It\u2019s an espresso drink with steamed milk.","https://images.pexels.com/photos/317377/pexels-photo-317377.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xB=new A.bh("15","Affogato","The affogato is an excuse to enjoy a scoop of ice cream any time of day (and any time of year in my opinion). Served with a scoop of ice cream and a shot of espresso, or two. The affogato is extra delish served over a brownie.","https://images.pexels.com/photos/9442600/pexels-photo-9442600.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xv=new A.bh("16","Caf\xe9 au Lait","Caf\xe9 au lait is perfect for the coffee minimalist who wants a bit more flavor. Just add a splash of warm milk to your coffee and you\u2019re all set!","https://images.pexels.com/photos/5865683/pexels-photo-5865683.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xD=new A.bh("17","Irish","Irish coffee consists of black coffee, whiskey and sugar, topped with whipped cream. Here\u2019s an Irish coffee recipe that will warm you right up.","https://images.pexels.com/photos/3860527/pexels-photo-3860527.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xd=new A.bh("18","Iced Coffee","A coffee with ice, typically served with a dash of milk, cream or sweetener\u2014iced coffee is really as simple as that. Iced coffee fanatics know that whipping up this delicious drink at home is tricky, so you\u2019ll want to try a Hyperchiller to master your DIY iced coffee recipe.","https://images.pexels.com/photos/1204148/pexels-photo-1204148.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xm=new A.bh("19","Iced Espresso","Like an iced coffee, iced espresso can be served straight or with a dash of milk, cream or sweetener. You can also ice speciality espresso-based drinks like americanos, mochas, macchiatos, lattes and flat whites.","https://images.pexels.com/photos/3165336/pexels-photo-3165336.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xi=new A.bh("20","Cold Brew","The trendiest of the iced coffee bunch, cold brew coffees are made by steeping coffee beans from anywhere between 6-36 hours, depending on how strong you would like your cold brew. Once the beans are done steeping, add cold milk or cream. Here are a few of our best cold brew coffee tips.","https://images.pexels.com/photos/1432528/pexels-photo-1432528.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xj=new A.bh("21","Frappuccino","Made famous by Starbucks, the Frappuccino is a blended iced coffee drink that\u2019s topped with whipped cream and syrup. But not all Frapps are made the same: watch out for coffee-free versions. Unless you\u2019re into that sorta thing.","https://images.pexels.com/photos/8743862/pexels-photo-8743862.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.xs=new A.bh("22","Nitro","A cold brew + nitrogen bubbles = a cold brew coffee with a frothy, Guinness-like consistency. (It\u2019s poured via a nitro tap, too.)","https://images.pexels.com/photos/5882702/pexels-photo-5882702.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
B.x8=new A.bh("23","Mazagran","Maza-who?! Mazagran coffee is a cross between iced coffee, tea and your favorite rum drink. It typically consists of espresso, lemon, sugar and (sometimes) rum.","https://images.pexels.com/photos/7474153/pexels-photo-7474153.jpeg?auto=compress&cs=tinysrgb&w=840&h=500&dpr=1")
